import d3 from 'd3';


var node = document.createElement('div');

var width = 960,
    height = 500;

var svg = d3.select(node).append("svg")
    .attr("width", width)
    .attr("height", height);

d3.csv("csv/eng.csv", function(data) {

    console.log(data);

})

  export default node;
